        setNotes(notes.filter((e) => e.key !== id));
    }

    return (
      <div className="App">
          <div className="card">
              <div className="head">
                  <h1>React notes</h1>
              </div>
              <div className="notes">
                  {notes.map((e) => (
                      <div className="notes-item">
                          <div style={{ width: "90%" }}>
                              <h4>Title: {e.title}</h4>
                              <p>Note: {e.des}</p>
                          </div>
                          <button
                              type="input"
                              style={{
                                  fontSize: "20px",
                                  width: "8%",
                                  height: "35px",
                                  padding: "0 2% 0 2%",
                                  color: "black",
                              }}
                              onClick={() => remove(e.key)}
                          >
                              X
                          </button>
                      </div>
                  ))}
                  <div className="add">
                      <h3>Add Notes</h3>
                      <input
                          type="text"
                          id="title"
                          placeHolder="Add title"
                          value={title}
                          onChange={(e) => setTitle(e.target.value)}
                      ></input>
                      <input
                          type="text"
                          id="description"
                          placeholder="Notes"
                          value={des}
